import logo from './logo.svg';
import { BrowserRouter, Routes, Route, Switch, Router } from 'react-router-dom';
import Header from './components/header/Header.jsx';
import Categories from './components/categories/Categories.jsx';
import Tags from './components/tags/Tags.jsx';
import './App.css';

function App() {
  return (
    <div className="App">
		<Router>
			<Switch>
				<Route path='/header_element/:id' component={HeaderElement}></Route>
			</Switch>
		</Router>
    	<Header></Header>
    	<div className="mainInterface">
        	<div className="catsAndTags">
        		<Categories title="Папки"></Categories>
        		<Tags></Tags>
        	</div>
        	<div className="mailList">
				<h1>Здесь будет поиск по названию писем, фильтр и сам список писем!</h1>
			</div>
			<div className="mailContent">
				<h1>Здесь будет содержание письма!</h1>
			</div>
    	</div>
    </div>
  );
}

export default App;
